      out.write("    \t\t\t\t\tINCAKE秉承了传统手工艺的蛋糕制作，甄选新鲜优质食材，传承纯正风味。蒂芙尼蛋糕官网|TIFFANY CAKE专注于向顾客提供全方位的体验，并带来卓越的价值。蒂芙尼蛋糕官网|TIFFANY CAKE打破了眼下传统的蛋糕销售模式，通过网络，移动端，客服热线全方位链接消费者，一对一定制蛋糕服务。让客户体验购物新风尚。\r\n");
      out.write("    \t\t\t\t\t在掌握了成熟的烘焙技艺以后，TIFFANY并没有停下自己的脚步。蛋糕，对TIFFANY而言从来不只是一款甜品，而是一个表达情感的载体。所以在烘焙出拥有完美口感的蛋糕的同时，TIFFANY赋予了蛋糕‘惊喜’的定义。每款TIFFANY蛋糕都是一场甜蜜的冒险，在打开蛋糕盒的那一刹那，我们希望看见的是惊喜的欢呼与满溢的笑脸。\r\n");
